def detect_labels(client, image):
    """Detects labels in the file."""


    response = client.label_detection(image=image)
    labels = response.label_annotations

    return labels

def detect_properties(client, image):


    response = client.image_properties(image=image)
    props = response.image_properties_annotation
    total_string = ""
    for color in props.dominant_colors.colors:
        total_string+= (str(color.pixel_fraction) +"|"+ str(color.color.red) +"|"+ str( color.color.green) +"|"+ str( color.color.blue) +"|"+ str(color.color.alpha))
        total_string += "!"
    return total_string

def write_csv(the_list, name):
    with open(name, "w", newline="") as csvFile: #note that this gives uneven array lengths so that i could use some of the "non usable" data later
        writer = csv.writer(csvFile)
        writer.writerows(the_list)
    csvFile.close()

